import React, { useState, useEffect } from "react";
import axios from "axios";
function App() {
    const [data, setData] = useState(null);

    useEffect(() => {
        axios.get("/fakeData").then((data) => {
            results = data.data;
            setData(results);
            console.log(results);
        });
    }, []);

    return <div className="App">{}</div>;
}

export default App;
